parts:
{
  "message_name": "UBX-NAV-STATUS",
  "message_id": "0x03",
  "class_id": "0x01",
  "message_type": "periodic_polled",
  "description": "Receiver navigation status",
  "payload_length": {
    "fixed": 16
  },
  "fields": [
    {
      "byte_offset": 0,
      "data_type": "U4",
      "name": "iTOW",
      "unit": "ms",
      "description": "GPS time of week of the navigation epoch."
    },
    {
      "byte_offset": 4,
      "data_type": "U1",
      "name": "gpsFix",
      "description": "GPSfix Type, this value does not qualify a fix as valid and within the limits. See note on flag gpsFixOk below.",
      "mapping": {
        "0": "no fix",
        "1": "dead reckoning only",
        "2": "2D-fix",
        "3": "3D-fix",
        "4": "GPS + dead reckoning combined",
        "5": "Time only fix",
        "6-255": "reserved"
      }
    },
    {
      "byte_offset": 5,
      "data_type": "X1",
      "name": "flags",
      "description": "Navigation Status Flags",
      "bit_fields": [
        {
          "bit_offset": 0,
          "bit_length": 1,
          "name": "gpsFixOk",
          "description": "1 = position and velocity valid and within DOP and ACC Masks."
        },
        {
          "bit_offset": 1,
          "bit_length": 1,
          "name": "diffSoln",
          "description": "1 = differential corrections were applied"
        },
        {
          "bit_offset": 2,
          "bit_length": 1,
          "name": "wknSet",
          "description": "1 = Week Number valid (for details, see section Time validity in the Integration manual)"
        },
        {
          "bit_offset": 3,
          "bit_length": 1,
          "name": "towSet",
          "description": "1 = Time of Week valid (for details, see section Time validity in the integration manual)"
        },
        {
          "bit_offset": 4,
          "bit_length": 4,
          "name": "reserved_flags",
          "reserved": true
        }
      ]
    },
    {
      "byte_offset": 6,
      "data_type": "X1",
      "name": "fixStat",
      "description": "Fix Status Information",
      "bit_fields": [
        {
          "bit_offset": 0,
          "bit_length": 1,
          "name": "diffCorr",
          "description": "1 = differential corrections available"
        },
        {
          "bit_offset": 1,
          "bit_length": 1,
          "name": "carrSolnValid",
          "description": "1 = valid carrSoln"
        },
        {
          "bit_offset": 2,
          "bit_length": 4,
          "name": "reserved_fixStat1",
          "reserved": true
        },
        {
          "bit_offset": 6,
          "bit_length": 2,
          "name": "mapMatching",
          "description": "map matching status",
          "mapping": {
            "0": "none",
            "1": "valid but not used, i.e. map matching data was received, but was too old",
            "2": "valid and used, map matching data was applied",
            "3": "valid and used, map matching data was applied. In case of sensor unavailability map matching data enables dead reckoning. This requires map matched latitude/longitude or heading data."
          }
        }
      ]
    },
    {
      "byte_offset": 7,
      "data_type": "X1",
      "name": "flags2",
      "description": "further information about navigation output",
      "bit_fields": [
        {
          "bit_offset": 0,
          "bit_length": 2,
          "name": "psmState",
          "description": "power save mode state (not supported for protocol versions less than 13.01)",
          "mapping": {
            "0": "ACQUISITION [or when psm disabled]",
            "1": "TRACKING",
            "2": "POWER OPTIMIZED TRACKING",
            "3": "INACTIVE"
          }
        },
        {
          "bit_offset": 2,
          "bit_length": 1,
          "name": "reserved_flags2_1",
          "reserved": true
        },
        {
          "bit_offset": 3,
          "bit_length": 2,
          "name": "spoofDetState",
          "description": "Spoofing detection state (not supported for protocol versions less than 18.00)",
          "mapping": {
            "0": "Unknown or deactivated",
            "1": "No spoofing indicated",
            "2": "Spoofing indicated",
            "3": "Multiple spoofing indications"
          }
        },
        {
          "bit_offset": 5,
          "bit_length": 1,
          "name": "reserved_flags2_2",
          "reserved": true
        },
        {
          "bit_offset": 6,
          "bit_length": 2,
          "name": "carrSoln",
          "description": "Carrier phase range solution status",
          "mapping": {
            "0": "no carrier phase range solution",
            "1": "carrier phase range solution with floating ambiguities",
            "2": "carrier phase range solution with fixed ambiguities"
          }
        }
      ]
    },
    {
      "byte_offset": 8,
      "data_type": "U4",
      "name": "ttff",
      "unit": "ms",
      "description": "Time to first fix (millisecond time tag)"
    },
    {
      "byte_offset": 12,
      "data_type": "U4",
      "name": "msss",
      "unit": "ms",
      "description": "Milliseconds since startup / reset"
    }
  ]
}
